      link: 'https://www.meetup.com/edulabs-Munchen/events/269086330/',
      description: '<p>Die edulabs M√ºnchen bieten zum EBmoocplus2020 eine Begleitgruppe an. Wir treffen dazu in den R√§umen von Wikipedia in M√ºnchen oder im Caf√© Netzwerk des KJR M√ºnchen.</p> <p>Inhalt des 7. Moduls:<br/>Die Teilnehmenden bekommen Einblick in Theorie und Praxis von Offenen Bildungsressourcen f√ºr ihre erwachsenenbildnerische T√§tigkeit. Sie lernen dabei, wie sie Ressourcen f√ºr die Erwachsenenbildung finden und korrekt verwenden, und erproben das in der Praxis. Die Produktion und Lizenzierung von Offenen Bildungsressourcen werden als Vertiefungsthemen angeboten.</p> <p>Was werden wir tun?<br/>t.b.a. (nach dem ersten Treffen)</p> <p>EBmoocplus2020 ‚Äìdas Wichtigste f√ºr die digitale Praxis in der Erwachsenenbildung<br/>Ein kostenloser Onlinekurs f√ºr Erwachsenenbildner/innen mit Austauschm√∂glichkeitin Foren, Webinaren und Begleitgruppen</p> <p>Kursinhalt und Ziele<br/>Teilnehmer/innen erwerben Erfahrung und Knowhow √ºber<br/>‚Ä¢ Erwachsenenbildung im digitalen Zeitalter<br/>‚Ä¢ Formate und Didaktik im digitalen Raum<br/>‚Ä¢ Digitale Werkzeuge f√ºr die Erwachsenenbildungs-Praxis<br/>‚Ä¢ Sicherheit und Datenschutz in der Erwachsenenbildung‚Ä¢Soziale Lernumgebungen im digitalen Raum<br/>‚Ä¢ Kritische Medienkompetenz und Erwachsenenbildung‚Ä¢Offene Bildungsressourcen<br/>‚Ä¢ Webinare und Live-Videoformate f√ºr die Erwachsenenbildung<br/>‚Ä¢ M√∂glichkeiten zum Weiterlernen</p> <p>Ablauf:<br/>‚Ä¢ 8 Module in 8 Wochen ab 4. M√§rz 2020 (Workload je 3-4 Stunden) + Abschlussmodul (2 Stunden)<br/>‚Ä¢ Es wird w√∂chentlich jeweils ein Modul freigeschaltet.<br/>‚Ä¢ Jede Einheit besteht aus einem einf√ºhrenden Video, erg√§nzenden Arbeitsmaterialien, einerAufgabenstellung dazu und einem kleinen Test zur (Selbst-)√úberpr√ºfung.<br/>‚Ä¢ Zus√§tzlich gibt es ein Forum zur Diskussion √ºber die Kursthemen.<br/>‚Ä¢ Au√üerdem werden begleitend unterschiedliche Typen von Webinaren angeboten<br/>‚Ä¢ Alle Materialien werden als Creative Commons Namensnennung 4.0 International Lizenz lizenziert und k√∂nnen auch nach Kursablauf weiter verwendet werden.</p> <p>Mehr Infos zum EBmoocplus2020 unter <a href="https://erwachsenenbildung.at/ebmooc" class="linkified">https://erwachsenenbildung.at/ebmooc</a></p> <p>Anmeldung zum EBmoocplus20202: <a href="https://imoox.at/mooc/local/courseintro/views/startpage.php?id=77" class="linkified">https://imoox.at/mooc/local/courseintro/views/startpage.php?id=77</a></p> <p>EBmooc plus erwachsenenbildung.at 2020<br/>CC BY 4.0 CONEDU #ebmoocplus20<br/>Gef√∂rdert aus Mitteln des Bundesministeriums f√ºr Bildung, Wissenschaft und Forschung</p> ',
