      link: 'https://www.meetup.com/Agile-Game-Night/events/266812756/',
      description: '<p>Daily Stand-up Game</p> <p>The Daily Stand-up Game contains 5 cards, each identifying one dysfunction and the Scrum Master is the one who introduces them into the Daily Meeting, showing the card when one dysfunction is being identified. After the team learns the cards, the Scrum Master gives the cards to the Team members to frame each other when identifying any dysfunction.<br/>At Agile Game Nights we will present the reloaded version of the Game, introducing new cards and new rules.<br/>If interested, we can also play more games that help improve the Daily Meeting. These are small games: Active Listening Game - Last Word</p> <p>During a Daily Simulation each person provides his/her inputs. The next person who speaks needs to start his updates with the last word the previous colleague used. People need to pay great attention and focus on the updates. This is a funny game to practice with the Team to break the monotony of the daily Daily :).</p> <p>Their Website: <a href="https://www.agilecricket.com/daily-stand-up-game-1" class="linkified">https://www.agilecricket.com/daily-stand-up-game-1</a></p> <p>Some Background to the game facilitators:</p> <p>Raluca Mitan: "I am an agile coach, trainer, innovator and learner. I support organisations in their agile journeys and love to experiment with teams and managers to continually improve work and make customers happy. My current playground is Zeiss Digital Innovation Partners, where I help develop great products and support innovation and creativity, as well as cooking together and promoting our great music band."</p> <p>Rade Zivanovic: "Rade Zivanovic is an agilist who coaches organisations, teams, colleagues and friends, sometimes even family members and pets (when they tolerate it).<br/>He\'s been working in agile since 2010 and loves it. He worked in development teams at the beginning of his career, so he knows how it feels to be on the other side as well. He enjoys helping people and seeing them succeed."</p> <p>Happy Gaming<br/>Ellen und Sieglinde</p> <p>PS: Du hast auch ein tolles Spiel und m√∂chtest uns das gern zeigen oder auch ausprobieren? Gastmoderatoren sind herzlich eingeladen. Sprich uns an.<br/>----------------------------<br/>Die Agile Game Night ist die Experimentierplattform f√ºr Business-Spiele</p> <p>Alle √úbungen und Spiele k√∂nnen in Trainings, Workshops, aber auch Scrum-Retrospektiven oder anderen agilen Meetings genutzt werden, im Team neue L√∂sungsans√§tze zu entwickeln und Erfahrungen erlebbar zu machen. Unsere Game Night ist f√ºr jeden gedacht, der mehr √ºber Agile Methoden erfahren und dabei Spa√ü haben und spielen m√∂chte. Dar√ºber hinaus k√∂nnen auch Trainer und Coaches davon profitieren, wie sie Spiele in ihre Seminare einbinden und diese vorab schon mal ausprobieren k√∂nnen.</p> <p>Spiele bilden metaphorisch reales Leben ab und helfen, Strukturen nicht nur theoretisch, sondern pers√∂nlich zu erleben, erfahren und verinnerlichen.</p> <p>Teilen Sie die Veranstaltung und laden Sie andere ein:</p> <p><a href="http://www.meetup.com/de-DE/Agile-Game-Night/" class="linkified">http://www.meetup.com/de-DE/Agile-Game-Night/</a><br/><a href="http://www.kiwi-COO-business-games.de" class="linkified">http://www.kiwi-COO-business-games.de</a><br/><a href="https://www.facebook.com/groups/agilegamenights/" class="linkified">https://www.facebook.com/groups/agilegamenights/</a></p> ',
